import React from 'react';
import Layout from '../../components/Layout';
import ProductStore from './ProductStore';
import './style.css';

/**
 * @author
 * @function ProductListPage
 **/

const ProductListPage = (props) => {
	return (
		<Layout>
			<ProductStore {...props} />>
		</Layout>
	);
};

export default ProductListPage;
